import React from 'react'

export default function AdminLoginForm() {

    const [formDatas, setFormDatas] = useState({
        username:'',
        password: '',
    });
    
    const handleSubmit1 = async (event) => {
        event.preventDefault();
    
        try {
            const response = await fetch('http://localhost:5000/api/loginuser', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json'
                },
                body: JSON.stringify(formDatas)
            });
    
            if (response.ok) {
                console.log('User logged in successfully');
            } else {
                // If response is not ok, parse the response body as JSON
                const errorData = await response.json();
                console.error('Error logging in:', errorData.message);
            }
        } catch (error) {
            console.error('Error logging in:', error);
        }
    };
    const handleChanges = (event) => {
        const { name, value } = event.target;
        setFormDatas((prevFormData) => ({
          ...prevFormData,
          [name]: value
        }));
      };
  return (
    <div>
        
        <div id="member" className="tabcontent">
            <form onSubmit={handleSubmit}>
                <label htmlFor="username">Username</label>
                <input type="text" name="username" value={formDatas.username} onChange={handleChange} required />

                <label htmlFor="password">Password</label>
                <input type="password" name="password" value={formDatas.password} onChange={handleChange} required />

                <input type="submit" value="Log in" />
                </form>
      </div>
    </div>
  )
}
